import React from "react";
import NewsItem from "../news-item";

const NewsList = ({ news }) => {
    console.log(news);
    return (
        <ul className="list-group">
            {news.map(
                ({
                     source,
                     author = '',
                     title,
                     description,
                     url,
                     urlToImage,
                     publishedAt
                 }) => {
                    return (
                        <li key={source.id} className="m-2 list-group-item">
                            {title}
                        </li>
                    );
                }
            )}
        </ul>
    );
};
export default NewsList;
